import {makeStyles} from "@material-ui/core/styles";
import Typography from "@material-ui/core/Typography";
import {BrowserRouter as Router, Link, Route, Switch} from "react-router-dom";
import AnimatedButton from '@bit/tabinda.react-button-animation.animated.button';
import '../css/footer.css'

const useStyles = makeStyles((theme) => ({

    frame : {
        width: '100%',
        height: 'auto',
        overflow: 'visible',
        backgroundColor: 'black',
        borderRadius: '5%',
    },

    text : {
        width: '100%',
        height: 'auto',
        overflow: 'visible',
        color: '#ffffff',
        fontSize: '18   px',
        letterSpacing: '1px',
        lineHeight: '1.5',
        textAlign: 'left',
        textTransform: 'capitalize',
        fontWeight: 600,
        fontFamily: `"Inter-ExtraBoldItalic", "Inter", sans-serif`,
    },
}));



function Footer (){

    function KeepFoot() {
        if (height < screen.height) {
            document.getElementById("footer").style.position = "fixed";
            document.getElementById("footer").style.bottom = "0";
            document.getElementById("footer").style.left = "0";
            document.getElementById("footer").style.right = "0";
        }
    }

    KeepFoot();


const myClass = useStyles();

    return(

        <footer id = "footer" style={{padding : '10px'}}>


<div className={myClass.frame}>


    <div className="row">


        <div className="col-md-4">
        <h3 className= {myClass.text}>SUPPORT</h3>
<Typography className={myClass.text}>We are here for you 24/7 , 24 hours and 7 days a week.
    We will be glad to know from you about our product.
    Simply give us your feed back. 

</Typography>

<Link to="/contact-us" style={{textDecoration: 'none' }} >

             <AnimatedButton style={{ marginTop: '20%' , align : 'center' }} label =    "Contact Us"/>

             </Link>

</div>
<div className="col-md-4">
<h3 className= {myClass.text}>ABOUT US</h3>
<Typography className= {myClass.text} style = {{alignText : 'center'}}>
    Designed By: UOL Students <br/>
    Supervisor: Sir Hassan Bajwa <br/>
    Ehtisham ur Rehman (70069403@student.uol.edu.pk) <br/>
    Saad Qadeer (70069780@student.uol.edu.pk)</Typography>

</div>

<div className="col-md-4">
<h3 className= {myClass.text}>PLATEFORM</h3>
<Typography className= {myClass.text} style = {{alignText : 'right'}}>
We are sorry to inform you that 
we are only available for desktop versions. 
Soon we will publish android app on the demand of subscribers</Typography>

</div>
</div>
    </div></footer>
)
}

export default Footer;
